import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, NavItem } from 'react-materialize';


const Menu = (props) => (
	<div >
		<Navbar left>
  		<NavItem>
  			<Link to='/'>
  				Comentarios
  			</Link>
  		</NavItem>

      <NavItem>
        <Link to='/fotos'>
          Fotos
        </Link>
  		</NavItem>
		</Navbar>
	</div>
);

export default Menu;
